import { Box, Typography, Grid, TextField, Button } from "@material-ui/core";

function HomePage({ setState }) {
  const [input, setInput] = React.useState({
    field1: "",
  });

  return (
    <Box>
      <Grid container style={{ width: "100%" }} spacing={2}>
        <Grid item xs={6}>
                  <Box height="500px" bgcolor="grey.300">
                      {input.field1}
          </Box>
          <Box mt={2} p={2} bgcolor="grey.200">
            <Grid container alignItems="center" spacing={2}>
              <Grid item xs>
                <TextField
                  fullWidth
                  name="field1"
                  variant="outlined"
                  value={input.field1}
                  onChange={(event) => setInput({ ...input, field1: event.target.value })}
                />
              </Grid>
              <Grid item>
                <Button color="primary" variant="contained" onClick={() => setState(input)}>
                  Update
                </Button>
              </Grid>
            </Grid>
          </Box>
        </Grid>
        <Grid item xs={6}>
          <Box height="500px" bgcolor="grey.300"></Box>
        </Grid>
      </Grid>
    </Box>
  );
}

export default HomePage;
